import requests
import os
import logging
logger = logging.getLogger(__name__)
from datetime import datetime


BASE_URL = os.getenv('IMGEN_BASE_URL', 'http://localhost:8001') # github.com/tonylampada/imgen

def generate(prompt):
    return _get('generate', prompt=prompt)

def generate_img2img(prompt, img_base64, strength=None):
    if strength is None:
        strength = 0.5
    return _post('generate_img2img', prompt=prompt, image_base64=img_base64, strength=strength)


def _get(command, **kwargs):
    url = f"{BASE_URL}/{command}"
    response = requests.get(url, params=kwargs)
    if response.status_code == 200:
        return response.text
    else:
        raise Exception(f"Error. Status code: {response.status_code} {response.text}")

def _post(command, **kwargs):
    url = f"{BASE_URL}/{command}"

    headers = {'Content-Type': 'application/json'}
    response = requests.post(url, json=kwargs, headers=headers)
    if response.status_code == 200:
        return response.text
    else:
        raise Exception(f"Error. Status code: {response.status_code} {response.text}")


